import ModuleList from "../Modules/ModuleList";
import "./index.css";

function Home() {
  return (
    <div class="wd-flex-grow">
    <div className="d-flex flex-row wd-flex-grow">
      <ModuleList />
      <div class="d-flex flex-column float-end status-bar">
        <button type="button" class="btn btn-secondary wd-flex-grow module-button">Collapse All</button>
      </div>
    </div>
    </div>
  );
}
export default Home;
